Naughty Bookworms - Reagan Ross 

Released: April 19, 2011

Reagan wants to withdraw from Professor Reed's course, but in order for that to happen, she needs him to sign off on it. However, when Reagan approaches her professor with her request, he tells her that they're already four weeks into the semester and that he needs a good reason to withdraw her, or else she'll have to drop the class and get a failing grade. That's not an option for Reagan, so she gives him the ol' &quot;You scratch my back, I'll suck your dick.&quot;
